import { FETCH_ALL_CALENDAR, CREATE_CALENDAR } from "../constants/actionTypes.js";

export default (teams = [], action) => {
    switch (action.type) {
        case FETCH_ALL_CALENDAR:
            return action.payload;
        case CREATE_CALENDAR:
            return [...teams, action.payload];
        default:
            return teams;
    }
};
